import disciplines from './data/disciplines';
import estimates from './data/estimates';

// import CurriculumsList from './components/Curriculums/CurriculumsList/CurriculumsList';

function App() {

  return (
    <div class="container">
      <Menu vertical>
        <Menu.Item
          name='inbox'
          active={activeItem === 'inbox'}
          onClick={this.handleItemClick}
        >
          <Label color='teal'>1</Label>
          Inbox
        </Menu.Item>

        <Menu.Item
          name='spam'
          active={activeItem === 'spam'}
          onClick={this.handleItemClick}
        >
          <Label>51</Label>
          Spam
        </Menu.Item>

        <Menu.Item
          name='updates'
          active={activeItem === 'updates'}
          onClick={this.handleItemClick}
        >
          <Label>1</Label>
          Updates
        </Menu.Item>
        <Menu.Item>
          <Input icon='search' placeholder='Search mail...' />
        </Menu.Item>
      </Menu>
    </div>
  );
}

export default App;
